import React from 'react'
import './sel.css'

function Selection() {
    function customer(){
        alert('login form')
    }
    function washer(){
        alert('login link')
    }

    return (
        <div>
            <div>
               
                <button onClick={customer} className='user'><h1>Login as Customer</h1></button>
                <h6>Create your Account </h6>
            </div>
            <div>
            
                <button onClick={washer}  className='wash'> <h1>Login as Washer</h1></button>
                <h6>Create your Account </h6>

            </div>
        </div>
    )
}

export default Selection
